let containerStyle = {
  display: "flex",
  width: "calc(65vw - 28px)",
  minWidth: "400px",
  fontWeight: "bold"
}

let containerMainStyle = {
  fontSize: "17px",
  minWidth: "200px",
  height: "25px",
  textAlign: "center",
  fontWeight: "bold"
}

let containerOtherStyle = {
  width: "16.667%"
}

let indexStyle = {
  listStyleType: "none",
  display: "flex",
  width: "100%",
  height: "22px",
}

export {
  containerStyle,
  containerMainStyle,
  containerOtherStyle,
  indexStyle,
}
